LD7uVKlK3LngGgkmd/2lTx+ueff75j8m9m7uO9DAkAAAAAHjuHbgZgaiulhYVPtLDwyUGHAgB4zDHzDwAAAAAO8RqAAAAAAAAAAHZ26GYAotbMa2KgfGdkAAAAAAAA7A1mAAIAAAAAAAA1jAQgAAAAAAAAUMNIAAIAAAAAAAA17P/8z92/HXQMAAAAAAAAAPbBsaON+v9r7zilpJpT+wAAAABJRU5ErkJggg==\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;// We use the `cy.get()` command to get all elements that match the selector.\n// Then, we use `should` to assert that there are two matched items,\n// which are the two default items.\ncy.get(&#x27;.todo-list li&#x27;).should(&#x27;have.length&#x27;, 3);\n// We can go even further and check that the default todos each contain\n// the correct text. We use the `first` and `last` functions\n// to get just the first and last matched elements individually,\n// and then perform an assertion with `should`.\ncy.get(&#x27;.todo-list li&#x27;).first().should(&#x27;have.text&#x27;, &#x27;Pay electric bill&#x27;);\ncy.get(&#x27;.todo-list li&#x27;).last().should(&#x27;have.text&#x27;, &#x27;Walk the dog&#x27;);&quot;,&quot;err&quot;:{&quot;message&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.&quot;,&quot;estack&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.\n    at Context.eval (webpack:///./cypress/e2e/todo.cy.ts:24:0)&quot;,&quot;diff&quot;:&quot;- 2\n+ 3\n&quot;},&quot;uuid&quot;:&quot;aadd6b99-66de-448f-a674-bf362b9975c2&quot;,&quot;parentUUID&quot;:&quot;3360baa5-34a3-4d1f-94cb-201846e7d2c9&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;can add new todo items&quot;,&quot;fullTitle&quot;:&quot;example to-do app can add new todo items&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:829,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;// We&#x27;ll store our item text in a variable so we can reuse it\nconst newItem = &#x27;Feed the cat&#x27;;\n// Let&#x27;s get the input element and use the `type` command to\n// input our new list item. After typing the content of our item,\n// we need to type the enter key as well in order to submit the input.\n// This input has a data-test attribute so we&#x27;ll use that to select the\n// element in accordance with best practices:\n// https://on.cypress.io/selecting-elements\ncy.get(&#x27;[data-test=new-todo]&#x27;).type(`${newItem}{enter}`);\n// Now that we&#x27;ve typed our new item, let&#x27;s check that it actually was added to the list.\n// Since it&#x27;s the newest item, it should exist as the last element in the list.\n// In addition, with the two default items, we should have a total of 3 elements in the list.\n// Since assertions yield the element that was asserted on,\n// we can chain both of these assertions together into a single statement.\ncy.get(&#x27;.todo-list li&#x27;).should(&#x27;have.length&#x27;, 3).last().should(&#x27;have.text&#x27;, newItem);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;4b086bed-1ee3-44b9-ab6e-9e75ed33de5c&quot;,&quot;parentUUID&quot;:&quot;3360baa5-34a3-4d1f-94cb-201846e7d2c9&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;can check off an item as completed&quot;,&quot;fullTitle&quot;:&quot;example to-do app can check off an item as completed&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:213,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;// In addition to using the `get` command to get an element by selector,\n// we can also use the `contains` command to get an element by its contents.\n// However, this will yield the &lt;label&gt;, which is lowest-level element that contains the text.\n// In order to check the item, we&#x27;ll find the &lt;input&g
